def count_2(ai):
    res = 0
    while not ai % 2:
        ai = ai // 2
        res += 1
    return res

def min_operations_to_divisible_by_2n(a, n):
    n2 = 0
    res = 0
    for ai in a:
        n2 += count_2(ai)
        if n2 >= n:
            return 0
    nearest_2 = 1
    n1 = n
    while n1 >= 2 ** nearest_2:
        nearest_2 += 1
    nearest_2 += 1
    n_2 = 1
    t_selected = 0
    while n2 < n and nearest_2 > 0:
        if n_2 > 0:
            n2 += nearest_2
            n_2 -= 1
            res += 1
            t_selected += 1
        else:
            nearest_2 -= 1
            n_2 = n // 2 ** nearest_2 - t_selected
    if n2 < n:
        return -1
    return res

